import React, { Component } from "react";
import Product from "./Product";

class ProductsTable extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return <Product productName={JSON.stringify(this.props.productsData[1])} />;
  }
}

export default ProductsTable;
